import {SIGN_OUT,SIGN_IN} from "./types";
import streams from'../apis/streams'

export const SignIn = (GoogleId) =>{
  return{
      type:SIGN_IN,
      payload:{ //remeber in video is different
          id:GoogleId
      }
  }
};
export const SignOut= () =>{
    return{
        type:SIGN_OUT
    }
};
